import React from 'react'

const AttributeExplaination = (props) => {
    return (
        <div>
            {props.attribute === 'industry' &&
                <div></div>
            }
            {props.attribute === 'name' &&
                <div></div>
            }
            {props.attribute === 'description' &&
                <div></div>
            }
            {props.attribute === 'start-date' &&
                <div></div>
            }
            {props.attribute === 'projection-period' &&
                <div></div>
            }
            {props.attribute === 'currency' &&
                <div></div>
            }
            {props.attribute === 'tax-rate' &&
                <div></div>
            }
            {props.attribute === 'discount' &&
                <div></div>
            }
            {props.attribute === 'sale-trend' &&
                <div></div>
            }
            {props.attribute === 'logo' &&
                <div></div>
            }
        </div>
    )
}

export default AttributeExplaination
